import React from "react";
import axios from "axios";
import { Fragment, useEffect, useState } from "react"; //to use function to get information  and useState to store data
import { BrowserRouter as Router, Route, Routes, useNavigate } from "react-router-dom";
import { Navigation, Home, Contact, SignUp, SignIn, Doctprofile, Logout, DoctAss } from "./components";
function App() {

  let history = useNavigate();
  const [isauthenticated,setisauthenticated] = useState(false);
  const [username,setusername] = useState('');
  const [countdrassignment,setcountdrassignment] = useState(0);
  con
  state = {
    isauthenticated: false,
    username: '',
    countdrassignment: 0,
    countalldoctor: 0
  }



  useEffect(() => {
    axios.get("http://localhost:4000/signin", { withCredentials: true })
      .then(res => this.setState({ isauthenticated: res.data.isauthenticated, username: res.data.username, countdrassignment: res.data.countdrassignment, countalldoctor: res.data.countalldoctor }))
      .catch(error => console.log(error));

  })



  //#region  Routers
  function RouterDocAss() {
    if (this.state.isauthenticated) {
      return (
        <Route exact path="/doctorAPP" element={<DoctAss />} />
      )
    }
    else {
      return (
        null
      )
    }
  }
  function RouterHome() {
    if (true) {
      return (
        <Route exact path="/" element={<Home />} />
      )
    }
  }
  function RouterLogout() {
    if (this.state.isauthenticated) {
      return (
        <Route exact path="/logout" element={<Logout />} />
      )
    }
    else {
      return (
        <Route exact path="/logout" element={<Home />} />
      )
    }
  }
  function RouterSignUp() {
    if (!this.state.isauthenticated) {
      return (
        <Route path="/signup" element={<SignUp />} />
      )
    }
    else {
      return (
        <Route path="/signup" element={<Doctprofile />} />
      )
    }
  }
  function RouterSignIn() {
    if (!this.state.isauthenticated) {
      return (
        <Route path="/signin" element={<SignIn />} />
      )
    }
    else {
      return (
        <Route path="/signin" element={<Doctprofile />} />
      )
    }
  }
  function RouterContact() {
    if (true) {
      return (
        <Route path="/contact" element={<Contact />} />
      )
    }
  }
  function RouterDoctprofile() {
    if (this.state.isauthenticated) {
      return (
        <Route path="/doctorNotAPP" element={<Doctprofile countalldoctor={this.state.countalldoctor} countdrassignment={this.state.countdrassignment} isauthenticated={this.state.isauthenticated} />} />
      )
    }
    else {
      return (
        null
      )
    }
  }
  //#endregion

  return (
    <div className="App">
      <Router>
        <Navigation countalldoctor={this.state.countalldoctor} countdrassignment={this.state.countdrassignment} isauthenticated={this.state.isauthenticated} username={this.state.username} />
        <Routes>
          {RouterHome()}
          {RouterSignUp()}
          {RouterContact()}
          {RouterDoctprofile()}
          {RouterSignIn()}
          {RouterLogout()}
          {RouterDocAss()}
        </Routes>
      </Router>
    </div>
  );
}
export default App;
